import React from "react"
import Link from "next/link"

import styled from "styled-components"

class Layout extends React.Component {
    state = { };

    render() {
        return (
            <main>
                <nav>
                    <ul>
                        <Link href="/">
                            <a>Home</a>
                        </Link>
                        <Link href="/about">
                            <a>About</a>
                        </Link>
                    </ul>
                </nav>
                {this.props.children}
            </main>
        );
    }
}

export default Layout;
